import React from "react";

function AdminDashboard() {
  return (
    <div className="min-h-screen bg-gray-900 text-white p-8">
      <h1 className="text-4xl font-bold mb-8 text-center">Admin Dashboard</h1>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-6 max-w-5xl mx-auto">
        {/* Card 1 */}
        <div className="bg-gray-800 p-6 rounded-2xl shadow-lg hover:shadow-xl transition duration-300">
          <h2 className="text-2xl font-semibold mb-2">üë• User Management</h2>
          <p className="text-gray-300">Create, edit, or remove user accounts and assign roles.</p>
        </div>

        {/* Card 2 */}
        <div className="bg-gray-800 p-6 rounded-2xl shadow-lg hover:shadow-xl transition duration-300">
          <h2 className="text-2xl font-semibold mb-2">üìú System Logs</h2>
          <p className="text-gray-300">Review backend activity and access history logs.</p>
        </div>

        {/* Card 3 */}
        <div className="bg-gray-800 p-6 rounded-2xl shadow-lg hover:shadow-xl transition duration-300">
          <h2 className="text-2xl font-semibold mb-2">üîê Permissions</h2>
          <p className="text-gray-300">Configure access levels for users and developers.</p>
        </div>

        {/* Card 4 */}
        <div className="bg-gray-800 p-6 rounded-2xl shadow-lg hover:shadow-xl transition duration-300">
          <h2 className="text-2xl font-semibold mb-2">‚öôÔ∏è Settings</h2>
          <p className="text-gray-300">Customize system preferences and deployment options.</p>
        </div>
      </div>
    </div>
  );
}

export default AdminDashboard;
